import React from 'react';
import './../styles/header.css';

const NavBar = () => {
  return (
    <div id='nav-bar'>
      <span className='header-link'>Work</span>
      <span className='header-link'>About</span>
      <span className='header-link'>Resume</span>
    </div>
  );
};

export default NavBar;
